INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 190804, 1, 1, 60000, 1, 1, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 0, 2, 60000, 1, 2, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 2, 60000, 1, 3, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 0, 2, 60000, 2, 4, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 0, 2, 60000, 1, 5, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 0, 2, 60000, 1, 6, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 0, 2, 60000, 2, 7, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 0, 2, 60000, 1, 8, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 0, 2, 60000, 1, 9, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 2, 60000, 1, 10, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 2, 60000, 1, 11, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 0, 2, 60000, 2, 12, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 0, 2, 60000, 1, 13, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 0, 2, 60000, 1, 14, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 0, 2, 60000, 1, 15, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, 2, 60000, 1, 16, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, 2, 60000, 2, 17, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 190804, 2, 3, 60000, 0, 18, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 190804, 3, 3, 60000, 0, 19, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ハツネ", 1, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 101201, 1, 0, 80001, 0, 20, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ハツネ", 1, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 101201, 2, 0, 80001, 0, 21, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シオリ", 1, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 103801, 1, 1, 80001, 0, 22, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シオリ", 1, "来年も、\n一緒にいられたら…\nうれしいな", 103801, 2, 1, 80001, 0, 23, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キョウカ", 2, "あなたと一緒にいるようになって、\nもう1年ですか…", 103601, 1, 0, 80001, 0, 24, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キョウカ", 2, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 103601, 2, 0, 80001, 0, 25, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ミミ", 2, "おにいちゃんとあってから、\n1年たったよ～！", 102001, 1, 1, 80001, 0, 26, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ミミ", 2, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 102001, 2, 1, 80001, 0, 27, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ミソギ", 2, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 100401, 1, 2, 80001, 0, 28, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ミソギ", 2, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 100401, 2, 2, 80001, 0, 29, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("マホ", 3, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 101001, 1, 0, 80001, 0, 30, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("マホ", 3, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 101001, 2, 0, 80001, 0, 31, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("イリヤ", 3, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 104401, 1, 1, 80001, 0, 32, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("イリヤ", 3, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 104401, 2, 1, 80001, 0, 33, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カオリ", 3, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 101701, 1, 2, 80001, 0, 34, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カオリ", 3, "これからも、どうぞよろしく\nお願いするさ～！", 101701, 2, 2, 80001, 0, 35, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("サレン", 4, "あんたと出会ってからもうそんなに\nたつのね～", 102801, 1, 0, 80001, 0, 36, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("サレン", 4, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 102801, 2, 0, 80001, 0, 37, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("スズメ", 4, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 102501, 1, 1, 80001, 0, 38, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("スズメ", 4, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 102501, 2, 1, 80001, 0, 39, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("タマキ", 5, "振り返れば、今までいろんなことが\nあったにゃあ…", 104601, 1, 0, 80001, 0, 40, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("タマキ", 5, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 104601, 2, 0, 80001, 0, 41, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ミフユ", 5, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 104801, 1, 1, 80001, 0, 42, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ミフユ", 5, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 104801, 2, 1, 80001, 0, 43, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("アキノ", 6, "あなたさまと出会ってもう1年…", 103201, 1, 0, 80001, 0, 44, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("アキノ", 6, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 103201, 2, 0, 80001, 0, 45, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ユカリ", 6, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 103401, 1, 1, 80001, 0, 46, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ユカリ", 6, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 103401, 2, 1, 80001, 0, 47, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("クリスティーナ", 7, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 107101, 1, 0, 80001, 0, 48, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("クリスティーナ", 7, "ともかくこれからも\n愉しませてくれよ☆", 107101, 2, 0, 80001, 0, 49, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ジュン", 7, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 104701, 1, 1, 80001, 0, 50, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ジュン", 7, "見えないから分からないって？\nそれもそうだな…", 104701, 2, 1, 80001, 0, 51, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("トモ", 8, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 103701, 1, 0, 80001, 0, 52, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("トモ", 8, "これからもよろしくね！", 103701, 2, 0, 80001, 0, 53, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("マツリ", 8, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 100501, 1, 1, 80001, 0, 54, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("マツリ", 8, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 100501, 2, 1, 80001, 0, 55, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ミヤコ", 9, "オマエと会って1年なの！\n全然成仏もできなかったし、", 100701, 1, 0, 80001, 0, 56, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ミヤコ", 9, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 100701, 2, 0, 80001, 0, 57, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シノブ", 9, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 103101, 1, 1, 80001, 0, 58, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シノブ", 9, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 103101, 2, 1, 80001, 0, 59, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("アンナ", 10, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 100901, 1, 0, 80001, 0, 60, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("アンナ", 10, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 100901, 2, 0, 80001, 0, 61, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ナナカ", 10, "君と出会ってもう1年だって！\n早いねー！", 101301, 1, 1, 80001, 0, 62, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ナナカ", 10, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 101301, 2, 1, 80001, 0, 63, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ミツキ", 11, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 105101, 1, 0, 80001, 0, 64, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ミツキ", 11, "これからも、いろんなところを\n調べさせてね？", 105101, 2, 0, 80001, 0, 65, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ルカ", 11, "お前さんと出会ってもう1年か\n助太刀するつもりが", 105601, 1, 1, 80001, 0, 66, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ルカ", 11, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 105601, 2, 1, 80001, 0, 67, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("エリコ", 11, "早いものですわね、あなた様と\nお会いして、もう1年…", 102701, 1, 2, 80001, 0, 68, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("エリコ", 11, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 102701, 2, 2, 80001, 0, 69, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("アヤネ", 12, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 102301, 1, 0, 80001, 0, 70, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("アヤネ", 12, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 102301, 2, 0, 80001, 0, 71, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("チカ", 12, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 104201, 1, 1, 80001, 0, 72, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("チカ", 12, "私のことを見守ってください\nできることなら、ずっと…", 104201, 2, 1, 80001, 0, 73, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("クルミ", 12, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 102101, 1, 2, 80001, 0, 74, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("クルミ", 12, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 102101, 2, 2, 80001, 0, 75, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シズル", 13, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 104901, 1, 0, 80001, 0, 76, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シズル", 13, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 104901, 2, 0, 80001, 0, 77, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("リノ", 13, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 101101, 1, 1, 80001, 0, 78, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("リノ", 13, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 101101, 2, 1, 80001, 0, 79, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ユイ", 14, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 100201, 1, 0, 80001, 0, 80, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ユイ", 14, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 100201, 2, 0, 80001, 0, 81, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ヒヨリ", 14, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 100101, 1, 1, 80001, 0, 82, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ヒヨリ", 14, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 100101, 2, 1, 80001, 0, 83, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("レイ", 14, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 100301, 1, 2, 80001, 0, 84, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("レイ", 14, "キミに背中を預けられる日が、\n早くきますように", 100301, 2, 2, 80001, 0, 85, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 15, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 105801, 1, 0, 80001, 0, 86, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 15, "これからもずっと、覚えていて\nくださいね！", 105801, 2, 0, 80001, 0, 87, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 15, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 105901, 1, 1, 80001, 0, 88, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 15, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 105901, 2, 1, 80001, 0, 89, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 15, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 106001, 1, 2, 80001, 0, 90, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 15, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 106001, 2, 2, 80001, 0, 91, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("スズメ", 0, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 112101, 1, 1, 60001, 1, 92, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 0, 2, 60001, 1, 93, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 2, 60001, 1, 94, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 0, 2, 60001, 1, 95, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 0, 2, 60001, 1, 96, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 0, 2, 60001, 2, 97, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 0, 2, 60001, 1, 98, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 0, 2, 60001, 1, 99, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 0, 2, 60001, 1, 100, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 0, 2, 60001, 1, 101, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 0, 2, 60001, 2, 102, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 0, 2, 60001, 1, 103, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 0, 2, 60001, 1, 104, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 2, 60001, 1, 105, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 2, 60001, 1, 106, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0, 0, 2, 60001, 1, 107, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, 0, 2, 60001, 1, 108, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 0, 2, 60001, 2, 109, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 0, 2, 60001, 1, 110, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 0, 2, 60001, 1, 111, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 0, 2, 60001, 1, 112, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, 2, 60001, 1, 113, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0, 2, 60001, 1, 114, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0, 0, 2, 60001, 1, 115, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, 2, 60001, 2, 116, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("スズメ", 0, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 112101, 2, 3, 60001, 0, 117, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("スズメ", 7, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 112101, 3, 3, 60001, 0, 118, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 1, "ヒューヒュー♪\nドンドンパフパフー♪", 105801, 1, 0, 80003, 0, 119, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 1, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 105901, 1, 1, 80003, 0, 120, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 1, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 105901, 2, 1, 80003, 0, 121, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 1, "え？　ちょっと\nいきなりなにっ？", 106001, 1, 2, 80003, 0, 122, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 1, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 106001, 2, 2, 80003, 0, 123, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 1, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 105801, 2, 0, 80003, 0, 124, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 1, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 105801, 3, 0, 80003, 0, 125, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 1, "ですからその日に向けて\n今から気分を盛り上げているのです", 105901, 3, 1, 80003, 0, 126, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 1, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 106001, 3, 2, 80003, 0, 127, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 1, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 105901, 4, 1, 80003, 0, 128, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 1, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 105801, 4, 0, 80003, 0, 129, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 1, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 106001, 4, 2, 80003, 0, 130, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 1, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 105901, 5, 1, 80003, 0, 131, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 2, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 106001, 5, 0, 80003, 0, 132, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 2, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 190801, 1, 1, 80003, 0, 133, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 2, "げっ…カリンじゃない\nなんでもないわよ！", 106001, 6, 0, 80003, 0, 134, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 2, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 190801, 2, 1, 80003, 0, 135, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 2, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 106001, 7, 0, 80003, 0, 136, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 2, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 190801, 3, 1, 80003, 0, 137, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 2, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 106001, 8, 0, 80003, 0, 138, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 2, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 106001, 9, 0, 80003, 0, 139, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 2, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 190801, 4, 1, 80003, 0, 140, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 2, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 106001, 10, 0, 80003, 0, 141, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 2, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 190801, 5, 1, 80003, 0, 142, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 2, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 106001, 11, 0, 80003, 0, 143, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 3, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 105901, 6, 0, 80003, 0, 144, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 3, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 105801, 5, 1, 80003, 0, 145, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 3, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 105901, 7, 0, 80003, 0, 146, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 3, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 105901, 8, 0, 80003, 0, 147, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 3, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 105801, 6, 1, 80003, 0, 148, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 3, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 105801, 7, 1, 80003, 0, 149, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 3, "あとは、牧場に素敵な温泉が\n出来たとか…", 105901, 9, 0, 80003, 0, 150, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 3, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 105801, 8, 1, 80003, 0, 151, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 3, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 105901, 10, 0, 80003, 0, 152, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 3, "えへへ、ありがとうございます\nコッコロちゃん！", 105801, 9, 1, 80003, 0, 153, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 3, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 105901, 11, 0, 80003, 0, 154, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 3, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 105801, 10, 1, 80003, 0, 155, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 4, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 105801, 11, 0, 80003, 0, 156, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 4, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 106001, 12, 1, 80003, 0, 157, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 4, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 105801, 12, 0, 80003, 0, 158, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 4, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 106001, 13, 1, 80003, 0, 159, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 4, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 105801, 13, 0, 80003, 0, 160, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 4, "…積極的？\nなんの話よ？", 106001, 14, 1, 80003, 0, 161, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 4, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 105801, 14, 0, 80003, 0, 162, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 4, "ムーサの町で\nきゃるきゃる～ん☆　って！", 105801, 15, 0, 80003, 0, 163, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 4, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 106001, 15, 1, 80003, 0, 164, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 4, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 105801, 16, 0, 80003, 0, 165, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 4, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 106001, 16, 1, 80003, 0, 166, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 4, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 106001, 17, 1, 80003, 0, 167, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 5, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 106001, 18, 0, 80003, 0, 168, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 5, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 105901, 12, 1, 80003, 0, 169, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 5, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 106001, 19, 0, 80003, 0, 170, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 5, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 105901, 13, 1, 80003, 0, 171, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 5, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 106001, 20, 0, 80003, 0, 172, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 5, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 105901, 14, 1, 80003, 0, 173, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 5, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 106001, 21, 0, 80003, 0, 174, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 5, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 105901, 15, 1, 80003, 0, 175, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 5, "かくし芸？", 106001, 22, 0, 80003, 0, 176, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 5, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 105901, 16, 1, 80003, 0, 177, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 5, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 106001, 23, 0, 80003, 0, 178, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 6, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 105801, 17, 0, 80003, 0, 179, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 6, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 106001, 24, 2, 80003, 0, 180, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 6, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 105901, 17, 1, 80003, 0, 181, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 6, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 105801, 18, 0, 80003, 0, 182, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 6, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 106001, 25, 2, 80003, 0, 183, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 6, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 105901, 18, 1, 80003, 0, 184, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 6, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 106001, 26, 2, 80003, 0, 185, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 6, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 106001, 27, 2, 80003, 0, 186, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 6, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 106001, 28, 2, 80003, 0, 187, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 6, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 105801, 19, 0, 80003, 0, 188, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 6, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 105901, 19, 1, 80003, 0, 189, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 6, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 106001, 29, 2, 80003, 0, 190, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 7, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 106001, 30, 0, 80003, 0, 191, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 7, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 106001, 31, 0, 80003, 0, 192, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 7, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 106001, 32, 0, 80003, 0, 193, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 7, "あー\nあー\n…声、これで大丈夫かしら？", 106001, 33, 0, 80003, 0, 194, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 7, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 106001, 34, 0, 80003, 0, 195, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 7, "オイッスー☆", 106001, 35, 0, 80003, 0, 196, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 7, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 106001, 36, 0, 80003, 0, 197, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 7, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 106001, 37, 0, 80003, 0, 198, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 7, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 106001, 38, 0, 80003, 0, 199, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 8, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 105901, 20, 0, 80003, 0, 200, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 8, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 105901, 21, 0, 80003, 0, 201, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 8, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 105901, 22, 0, 80003, 0, 202, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 8, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 105901, 23, 0, 80003, 0, 203, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 8, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 105901, 24, 0, 80003, 0, 204, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 8, "オイッスー☆", 105901, 25, 0, 80003, 0, 205, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 8, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 105901, 26, 0, 80003, 0, 206, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 8, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 105901, 27, 0, 80003, 0, 207, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 8, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 105901, 28, 0, 80003, 0, 208, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 9, "オイッスー☆", 105801, 20, 0, 80003, 0, 209, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 9, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 105801, 21, 0, 80003, 0, 210, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 9, "あと６日で2.5周年ですか…", 105801, 22, 0, 80003, 0, 211, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 9, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 105801, 23, 0, 80003, 0, 212, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 9, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 105801, 24, 0, 80003, 0, 213, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 9, "オイッスー☆", 105801, 25, 0, 80003, 0, 214, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 9, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 105801, 26, 0, 80003, 0, 215, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 9, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 105801, 27, 0, 80003, 0, 216, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 9, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 105801, 28, 0, 80003, 0, 217, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 9, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 105801, 29, 0, 80003, 0, 218, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 9, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 105801, 30, 0, 80003, 0, 219, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 10, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 105801, 31, 0, 80003, 0, 220, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 10, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 105901, 29, 1, 80003, 0, 221, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 10, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 105801, 32, 0, 80003, 0, 222, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 10, "…………", 106001, 39, 2, 80003, 0, 223, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 10, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 105901, 30, 1, 80003, 0, 224, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 10, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 106001, 40, 2, 80003, 0, 225, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 10, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 105801, 33, 0, 80003, 0, 226, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 10, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 106001, 41, 2, 80003, 0, 227, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 10, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 105801, 34, 0, 80003, 0, 228, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 10, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 105801, 35, 0, 80003, 0, 229, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 10, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 106001, 42, 2, 80003, 0, 230, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 10, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 105901, 31, 1, 80003, 0, 231, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 10, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 106001, 43, 2, 80003, 0, 232, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 10, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 105801, 36, 0, 80003, 0, 233, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 11, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 190801, 6, 0, 80003, 0, 234, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 11, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 190801, 7, 0, 80003, 0, 235, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 11, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 190801, 8, 0, 80003, 0, 236, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 11, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 190801, 9, 0, 80003, 0, 237, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 11, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 190801, 10, 0, 80003, 0, 238, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 11, "次にコッコロさんですが\nこちらは発声練習をしています", 190801, 11, 0, 80003, 0, 239, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 11, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 190801, 12, 0, 80003, 0, 240, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 11, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 190801, 13, 0, 80003, 0, 241, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 11, "あれ？\nもしかして緊張で気を失って…？", 190801, 14, 0, 80003, 0, 242, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 11, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 190801, 15, 0, 80003, 0, 243, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 11, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 190801, 16, 0, 80003, 0, 244, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 11, "それでは\nまた明日お会いしましょう♪", 190801, 17, 0, 80003, 0, 245, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 12, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 106001, 44, 0, 80003, 0, 246, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 12, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 105801, 37, 2, 80003, 0, 247, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 12, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 105901, 32, 1, 80003, 0, 248, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 12, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 106001, 45, 0, 80003, 0, 249, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 12, "ひどいですよぉキャルちゃ～ん！", 105801, 38, 2, 80003, 0, 250, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 12, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 105901, 33, 1, 80003, 0, 251, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 12, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 105801, 39, 2, 80003, 0, 252, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 12, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 106001, 46, 0, 80003, 0, 253, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 12, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 105901, 34, 1, 80003, 0, 254, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 12, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 105801, 40, 2, 80003, 0, 255, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 13, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 105801, 41, 0, 80003, 0, 256, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 13, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 106001, 47, 2, 80003, 0, 257, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 13, "忘れてきちゃいました☆", 105801, 42, 0, 80003, 0, 258, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 13, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 106001, 48, 2, 80003, 0, 259, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 13, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 105901, 35, 1, 80003, 0, 260, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 13, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 106001, 49, 2, 80003, 0, 261, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 13, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 105801, 43, 0, 80003, 0, 262, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 13, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 106001, 50, 2, 80003, 0, 263, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 13, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 105901, 36, 1, 80003, 0, 264, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 13, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 106001, 51, 2, 80003, 0, 265, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 13, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 105901, 37, 1, 80003, 0, 266, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 13, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 106001, 52, 2, 80003, 0, 267, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 13, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 105801, 44, 0, 80003, 0, 268, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 13, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 105901, 38, 1, 80003, 0, 269, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 13, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 105801, 45, 0, 80003, 0, 270, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 13, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 106001, 53, 2, 80003, 0, 271, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 13, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 105801, 46, 0, 80003, 0, 272, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 14, "こんにちは\n【ギルド管理協会】のカリンです", 190801, 18, 0, 80003, 0, 273, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 14, "昨日の生放送は\nいかがだったでしょうか？", 190801, 19, 0, 80003, 0, 274, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 14, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 190801, 20, 0, 80003, 0, 275, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 14, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 190801, 21, 0, 80003, 0, 276, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 14, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 190801, 22, 0, 80003, 0, 277, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 14, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 190801, 23, 0, 80003, 0, 278, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 14, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 190801, 24, 0, 80003, 0, 279, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 14, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 190801, 25, 0, 80003, 0, 280, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 14, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 190801, 26, 0, 80003, 0, 281, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 14, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 190801, 27, 0, 80003, 0, 282, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 15, "準備はいいですかっ？\n…いっきますよー！", 105801, 47, 0, 80003, 0, 283, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 15, "祝！", 106001, 54, 2, 80003, 0, 284, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 15, "2.5周年！", 105901, 39, 1, 80003, 0, 285, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 15, "おめでとうございま～す☆", 105801, 48, 0, 80003, 0, 286, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 15, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 106001, 55, 2, 80003, 0, 287, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 15, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 105901, 40, 1, 80003, 0, 288, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 15, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 105801, 49, 0, 80003, 0, 289, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 15, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 106001, 56, 2, 80003, 0, 290, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 15, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 105901, 41, 1, 80003, 0, 291, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 15, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 106001, 57, 2, 80003, 0, 292, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 15, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 105801, 50, 0, 80003, 0, 293, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 15, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 106001, 58, 2, 80003, 0, 294, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 15, "記念日だから\n平気平気♪\nやばいですね☆", 105801, 51, 0, 80003, 0, 295, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 15, "意味分かんないわよ！", 106001, 59, 2, 80003, 0, 296, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 15, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 105901, 42, 1, 80003, 0, 297, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 15, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 105901, 43, 1, 80003, 0, 298, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 15, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 105801, 52, 0, 80003, 0, 299, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 15, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 106001, 60, 2, 80003, 0, 300, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 15, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 105901, 44, 1, 80003, 0, 301, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 15, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 105801, 53, 0, 80003, 0, 302, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ・コッコロ・キャル", 15, "2.5周年\nありがとうございます！", 105801, 54, 0, 80003, 0, 303, 0, 1, "105901,45,106001,61");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 190804, 1, 1, 60002, 1, 304, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 0, 2, 60002, 1, 305, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 2, 60002, 1, 306, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 0, 2, 60002, 1, 307, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 0, 2, 60002, 1, 308, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 0, 2, 60002, 2, 309, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 0, 2, 60002, 1, 310, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 0, 2, 60002, 1, 311, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 0, 2, 60002, 1, 312, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 0, 2, 60002, 1, 313, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 0, 2, 60002, 2, 314, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 0, 2, 60002, 1, 315, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 0, 2, 60002, 1, 316, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 2, 60002, 1, 317, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 0, 2, 60002, 1, 318, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0, 0, 2, 60002, 1, 319, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 2, 60002, 1, 320, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0, 0, 2, 60002, 2, 321, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 0, 2, 60002, 1, 322, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 0, 2, 60002, 1, 323, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 0, 2, 60002, 1, 324, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0, 2, 60002, 1, 325, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0, 2, 60002, 1, 326, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 0, 2, 60002, 1, 327, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0, 2, 60002, 2, 328, 4, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 190804, 2, 3, 60002, 0, 329, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 190804, 3, 3, 60002, 0, 330, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 1, "ささ、シェフィさまはこちらへ…", 105901, 1, 4, 80005, 0, 331, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 1, "コッコロさん、どこへ行くの…？\n…え？", 106401, 1, 0, 80005, 0, 332, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 1, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 105801, 1, 3, 80005, 0, 333, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 1, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 105901, 2, 4, 80005, 0, 334, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 1, "ええと…\n二人とも何をしているの？", 106401, 2, 0, 80005, 0, 335, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 1, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 106001, 1, 1, 80005, 0, 336, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 1, "あの日…？", 106401, 3, 0, 80005, 0, 337, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 1, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 105801, 2, 3, 80005, 0, 338, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 1, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 105801, 3, 3, 80005, 0, 339, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 1, "やばいですね☆", 190801, 1, 2, 80005, 0, 340, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 1, "って、なにしれっと\n参加してんのよカリン！", 106001, 2, 1, 80005, 0, 341, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 1, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 190801, 2, 2, 80005, 0, 342, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 1, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 190801, 3, 2, 80005, 0, 343, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 1, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 105801, 4, 3, 80005, 0, 344, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 1, "えっ！？　ええとええと…！\nあ、あと14日…！", 106401, 4, 0, 80005, 0, 345, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 2, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 105801, 5, 3, 80005, 0, 346, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 2, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 105901, 3, 1, 80005, 0, 347, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 2, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 105901, 4, 1, 80005, 0, 348, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 2, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 105801, 6, 3, 80005, 0, 349, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 2, "さすがでございます\nペコリーヌさま", 105901, 5, 1, 80005, 0, 350, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 2, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 106001, 3, 0, 80005, 0, 351, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 2, "しゃなり、しゃなり…\nふふ、案外できるものね", 106401, 5, 2, 80005, 0, 352, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 2, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 105801, 7, 3, 80005, 0, 353, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 2, "さ、次はキャルさまの\n番でございますよ", 105901, 6, 1, 80005, 0, 354, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 2, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 106001, 4, 0, 80005, 0, 355, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 2, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 106401, 6, 2, 80005, 0, 356, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 2, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 106001, 5, 0, 80005, 0, 357, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 2, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 106001, 6, 0, 80005, 0, 358, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 2, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 105901, 7, 1, 80005, 0, 359, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 2, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 106001, 7, 0, 80005, 0, 360, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 3, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 105901, 8, 1, 80005, 0, 361, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 3, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 105801, 8, 3, 80005, 0, 362, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 3, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 105901, 9, 1, 80005, 0, 363, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 3, "聖学祭…って、なにかしら？", 106401, 7, 2, 80005, 0, 364, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 3, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 105901, 10, 1, 80005, 0, 365, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 3, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 106001, 8, 0, 80005, 0, 366, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 3, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 106001, 9, 0, 80005, 0, 367, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 3, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 105801, 9, 3, 80005, 0, 368, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 3, "いや、そのまんますぎでしょ…", 106001, 10, 0, 80005, 0, 369, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 3, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 106401, 8, 2, 80005, 0, 370, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 3, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 105801, 10, 3, 80005, 0, 371, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 3, "えっ？　ええ…\nぎゅーっ…？", 106401, 9, 2, 80005, 0, 372, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 4, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 106001, 11, 0, 80005, 0, 373, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 4, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 106401, 10, 2, 80005, 0, 374, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 4, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 106001, 12, 0, 80005, 0, 375, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 4, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 105901, 11, 1, 80005, 0, 376, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 4, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 106001, 13, 0, 80005, 0, 377, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 4, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 105801, 11, 3, 80005, 0, 378, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 4, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 106001, 14, 0, 80005, 0, 379, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 4, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 106001, 15, 0, 80005, 0, 380, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 4, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 106401, 11, 2, 80005, 0, 381, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 4, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 105801, 12, 3, 80005, 0, 382, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 4, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 105901, 12, 1, 80005, 0, 383, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 4, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 106001, 16, 0, 80005, 0, 384, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 4, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 106401, 12, 2, 80005, 0, 385, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 5, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 105801, 13, 3, 80005, 0, 386, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 5, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 105801, 14, 3, 80005, 0, 387, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 5, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 105801, 15, 3, 80005, 0, 388, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 5, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 106001, 17, 0, 80005, 0, 389, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 5, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 106001, 18, 0, 80005, 0, 390, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 5, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 106401, 13, 2, 80005, 0, 391, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 5, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 105901, 13, 1, 80005, 0, 392, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 5, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 105801, 16, 3, 80005, 0, 393, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 5, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 106001, 19, 0, 80005, 0, 394, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 5, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 105801, 17, 3, 80005, 0, 395, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 5, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 105801, 18, 3, 80005, 0, 396, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 5, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 105801, 19, 3, 80005, 0, 397, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 6, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 190801, 4, 2, 80005, 0, 398, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 6, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 190801, 5, 2, 80005, 0, 399, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 6, "…えっ！？", 106001, 20, 1, 80005, 0, 400, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 6, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 105801, 20, 3, 80005, 0, 401, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 6, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 106401, 14, 0, 80005, 0, 402, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 6, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 105901, 14, 4, 80005, 0, 403, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 6, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 106401, 15, 0, 80005, 0, 404, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 6, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 106001, 21, 1, 80005, 0, 405, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 6, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 105801, 21, 3, 80005, 0, 406, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 6, "ぶっ殺すぞ！？", 106001, 22, 1, 80005, 0, 407, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 6, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 190801, 6, 2, 80005, 0, 408, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 7, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 105901, 15, 1, 80005, 0, 409, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 7, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 106001, 23, 0, 80005, 0, 410, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 7, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 106401, 16, 2, 80005, 0, 411, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 7, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 105801, 22, 3, 80005, 0, 412, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 7, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 106001, 24, 0, 80005, 0, 413, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 7, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 106401, 17, 2, 80005, 0, 414, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 7, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 105901, 16, 1, 80005, 0, 415, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 7, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 106401, 18, 2, 80005, 0, 416, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 7, "もちろんでございます\n仲良くお勉強いたしましょう", 105901, 17, 1, 80005, 0, 417, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 7, "しれっと教育ママが\n生まれてる…？", 106001, 25, 0, 80005, 0, 418, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 7, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 105801, 23, 3, 80005, 0, 419, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 7, "え～～～～！？", 106001, 26, 0, 80005, 0, 420, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 8, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 106001, 27, 0, 80005, 0, 421, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 8, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 106401, 19, 2, 80005, 0, 422, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 8, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 105901, 18, 1, 80005, 0, 423, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 8, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 105801, 24, 3, 80005, 0, 424, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 8, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 106401, 20, 2, 80005, 0, 425, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 8, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 106001, 28, 0, 80005, 0, 426, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 8, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 105901, 19, 1, 80005, 0, 427, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 8, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 106401, 21, 2, 80005, 0, 428, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 8, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 106001, 29, 0, 80005, 0, 429, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 8, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 106001, 30, 0, 80005, 0, 430, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 8, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 105801, 25, 3, 80005, 0, 431, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 8, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 106001, 31, 0, 80005, 0, 432, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 9, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 106401, 22, 0, 80005, 0, 433, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 9, "…えっ？\n生放送の意気込み！？\n突然なに！？", 106401, 23, 0, 80005, 0, 434, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 9, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 106401, 24, 0, 80005, 0, 435, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 9, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 106401, 25, 0, 80005, 0, 436, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 9, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 106401, 26, 0, 80005, 0, 437, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 9, "それから、それから…！\nぅ、ぅぅっ…！", 106401, 27, 0, 80005, 0, 438, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 9, "―びえぇぇ～んっ！！！", 106401, 28, 0, 80005, 0, 439, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 9, "どうされましたか、シェフィさま", 105901, 20, 1, 80005, 0, 440, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 9, "ううっ…ひっく…\nママッ…！", 106401, 29, 0, 80005, 0, 441, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 9, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 105901, 21, 1, 80005, 0, 442, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 9, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 105901, 22, 1, 80005, 0, 443, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 9, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 106401, 30, 0, 80005, 0, 444, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 10, "主さま\n3.5周年まであと５日\nでございます", 105901, 23, 0, 80005, 0, 445, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 10, "ですがその前に\n生放送がありますね", 105901, 24, 0, 80005, 0, 446, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 10, "…生放送に向けた\n意気込みでございますか？", 105901, 25, 0, 80005, 0, 447, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 10, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 105901, 26, 0, 80005, 0, 448, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 10, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 105901, 27, 0, 80005, 0, 449, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 10, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 105901, 28, 0, 80005, 0, 450, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 10, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 105901, 29, 0, 80005, 0, 451, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 10, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 105901, 30, 0, 80005, 0, 452, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 10, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 105901, 31, 0, 80005, 0, 453, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 11, "3.5周年まであと４日！\nやばいですね☆", 105801, 26, 0, 80005, 0, 454, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 11, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 106001, 32, 1, 80005, 0, 455, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 11, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 105801, 27, 0, 80005, 0, 456, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 11, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 105801, 28, 0, 80005, 0, 457, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 11, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 105801, 29, 0, 80005, 0, 458, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 11, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 106001, 33, 1, 80005, 0, 459, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 11, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 105801, 30, 0, 80005, 0, 460, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 11, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 105801, 31, 0, 80005, 0, 461, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 11, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 105801, 32, 0, 80005, 0, 462, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 11, "だからあたしはやるなんて一言も…", 106001, 34, 1, 80005, 0, 463, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 11, "オイッスー☆", 105801, 33, 0, 80005, 0, 464, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 11, "聞きなさいっての！！", 106001, 35, 1, 80005, 0, 465, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 12, "3.5周年まであと３日…\nそして生放送は、明日…", 106401, 31, 2, 80005, 0, 466, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 12, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 106401, 32, 2, 80005, 0, 467, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 12, "おいっす！\n…こうじゃなかったわね\nええと確か…", 106401, 33, 2, 80005, 0, 468, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 12, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 106401, 34, 2, 80005, 0, 469, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 12, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 106401, 35, 2, 80005, 0, 470, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 12, "やってますねシェフィちゃん！", 105801, 34, 3, 80005, 0, 471, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 12, "なによ、考えることは\nみんな同じってこと？", 106001, 36, 0, 80005, 0, 472, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 12, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 105901, 32, 1, 80005, 0, 473, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 12, "みんな…もちろんよ！", 106401, 36, 2, 80005, 0, 474, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 12, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 105801, 35, 3, 80005, 0, 475, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 13, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 190801, 7, 2, 80005, 0, 476, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 13, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 190801, 8, 2, 80005, 0, 477, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 13, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 105801, 36, 3, 80005, 0, 478, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 13, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 190801, 9, 2, 80005, 0, 479, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 13, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 105901, 33, 4, 80005, 0, 480, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 13, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 190801, 10, 2, 80005, 0, 481, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 13, "大丈夫…大丈夫…\nあたしは大丈夫…", 106001, 37, 1, 80005, 0, 482, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 13, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 190801, 11, 2, 80005, 0, 483, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 13, "あうー？", 106401, 37, 0, 80005, 0, 484, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("みんな", 13, "あ…", 105801, 37, 4, 80005, 0, 485, 0, 1, "105901,34,106001,38,190801,12");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 13, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 106001, 39, 1, 80005, 0, 486, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 13, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 105901, 35, 4, 80005, 0, 487, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 13, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 105801, 38, 3, 80005, 0, 488, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 13, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 190801, 13, 2, 80005, 0, 489, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 14, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 106401, 38, 2, 80005, 0, 490, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 14, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 105801, 39, 3, 80005, 0, 491, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 14, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 106001, 40, 0, 80005, 0, 492, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 14, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 105901, 36, 1, 80005, 0, 493, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 14, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 106401, 39, 2, 80005, 0, 494, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 14, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 105801, 40, 3, 80005, 0, 495, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 14, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 105901, 37, 1, 80005, 0, 496, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 14, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 106001, 41, 0, 80005, 0, 497, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 14, "へ、へぇ…", 106401, 40, 2, 80005, 0, 498, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 14, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 105801, 41, 3, 80005, 0, 499, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 14, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 106401, 41, 2, 80005, 0, 500, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 14, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 106401, 42, 2, 80005, 0, 501, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 15, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 105801, 42, 3, 80005, 0, 502, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 15, "祝！", 106001, 42, 1, 80005, 0, 503, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 15, "3.5周年！", 105901, 38, 4, 80005, 0, 504, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 15, "おめでとうございます！", 106401, 43, 0, 80005, 0, 505, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 15, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 190801, 14, 2, 80005, 0, 506, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 15, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 190801, 15, 2, 80005, 0, 507, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 15, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 105801, 43, 3, 80005, 0, 508, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 15, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 105801, 44, 3, 80005, 0, 509, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 15, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 106001, 43, 1, 80005, 0, 510, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("キャル", 15, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 106001, 44, 1, 80005, 0, 511, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 15, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 106401, 44, 0, 80005, 0, 512, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("シェフィ", 15, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 106401, 45, 0, 80005, 0, 513, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 15, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 105901, 39, 4, 80005, 0, 514, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 15, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 105901, 40, 4, 80005, 0, 515, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("コッコロ", 15, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 105901, 41, 4, 80005, 0, 516, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("ペコリーヌ", 15, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 105801, 45, 3, 80005, 0, 517, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("みんな", 15, "これからも\nよろしくおねがいします！", 105801, 46, 4, 80005, 0, 518, 0, 1, "105901,42,106001,45,106401,46,190801,16");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("カリン", 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 190804, 1, 1, 60003, 1, 519, 0, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 0, 2, 60003, 1, 520, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0, 2, 60003, 1, 521, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, 0, 2, 60003, 1, 522, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 0, 0, 2, 60003, 1, 523, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 0, 2, 60003, 2, 524, 1, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 0, 2, 60003, 1, 525, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 0, 2, 60003, 1, 526, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 0, 0, 2, 60003, 1, 527, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0, 0, 2, 60003, 1, 528, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 0, 2, 60003, 2, 529, 2, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 0, 2, 60003, 1, 530, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 0, 2, 60003, 1, 531, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0, 2, 60003, 1, 532, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 0, 2, 60003, 1, 533, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0, 0, 2, 60003, 1, 534, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0, 2, 60003, 1, 535, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 0, 0, 2, 60003, 2, 536, 3, 0, "");
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 0, 2, 60003, 1, 537, 4, 0, "");
